
Class AudioByteSize
{
    [UInt64]  $Bytes
    [String]   $Unit
    [String]   $Size
    AudioByteSize([UInt64]$Bytes)
    {
        $This.Bytes  = $Bytes
        $This.GetUnit()
        $This.GetSize()
    }
    GetUnit()
    {
        $This.Unit   = Switch ($This.Bytes)
        {
            {$_ -lt 1KB}                 {     "Byte" }
            {$_ -ge 1KB -and $_ -lt 1MB} { "Kilobyte" }
            {$_ -ge 1MB -and $_ -lt 1GB} { "Megabyte" }
            {$_ -ge 1GB -and $_ -lt 1TB} { "Gigabyte" }
            {$_ -ge 1TB}                 { "Terabyte" }
        }
    }
    GetSize()
    {
        $This.Size   = Switch -Regex ($This.Unit)
        {
            ^Byte     {     "{0} B" -f  $This.Bytes      }
            ^Kilobyte { "{0:n2} KB" -f ($This.Bytes/1KB) }
            ^Megabyte { "{0:n2} MB" -f ($This.Bytes/1MB) }
            ^Gigabyte { "{0:n2} GB" -f ($This.Bytes/1GB) }
            ^Terabyte { "{0:n2} TB" -f ($This.Bytes/1TB) }
        }
    }
    [String] ToString()
    {
        Return $This.Size
    }
}

Class AudioEntry
{
    [UInt32]      $Index
    [String]       $Date
    [String]       $Name
    [String]       $Type
    [TimeSpan] $Duration
    [Object]       $Size
    [String]   $Fullname
    AudioEntry([UInt32]$Index,[Object]$File,[String]$Duration)
    {
        $This.Index    = $Index
        $This.Date     = $File.ModifyDate.ToString("MM/dd/yyyy HH:mm:ss")
        $This.Name     = $File.Name
        $This.Type     = $File.Type.Split(" ")[0]
        $xDuration     = [TimeSpan]$Duration
        If ($xDuration)
        {
            $This.Duration = $Duration
        }
        
        $This.Size     = $This.AudioByteSize($File.Size)
        $This.Fullname = $File.Path
    }
    [Object] AudioByteSize([UInt64]$Bytes)
    {
        Return [AudioByteSize]::New([UInt64]$Bytes)
    }
}

Class AudioController
{
    [String]          $Name
    [Object]          $Path
    Hidden [Object] $Folder
    [Object]        $Output
    AudioController([String]$Name,[String]$Path)
    {
        $This.Name   = $Name
        $This.Path   = $Path
        $This.Folder = $This.ComObject().Namespace($Path)
    }
    [Object] AudioEntry([Uint32]$Index,[Object]$File,[String]$Duration)
    {
        Return [AudioEntry]::New($Index,$File,$Duration)
    }
    [Object] ComObject()
    {
        Return New-Object -ComObject Shell.Application
    }
    [Object[]] GetObject()
    {
        Return @($This.Folder.Items())
    }
    Clear()
    {
        $This.Output = @( )
    }
    Add([Object]$File)
    {
        If ($File.Name -in $This.Output.Name)
        {
            Throw "Duplicate entry"
        }

        $This.Output += $This.AudioEntry($This.Output.Count,$File,$This.Folder.GetDetailsOf($File,27))
    }
    Populate()
    {
        $This.Clear()

        ForEach ($File in $This.GetObject())
        {
            $This.Add($File)
        }
    }
    [String] ToString()
    {
        Return "{0}, collection ({1}) file(s)" -f $This.Name, $This.Output.Count
    }
}

